import React from "react";
import { GameOverContainer, Button, Buttons, Winner } from "./GameOverElements";

const GameOver = ({ show, winner }) => {
    return (
        <GameOverContainer show={show}>
            <Winner>
                <div class="w">W</div>
                <div class="i">I</div>
                <div class="n1">N</div>
                <div class="n2">N</div>
                <div class="e">E</div>
                <div class="r">R</div>
            </Winner>
            <div>{winner}</div>
            <Buttons>
                <Button>Restart</Button>
                <Button>Swap</Button>
                <Button>Exit</Button>
            </Buttons>
        </GameOverContainer>
    );
};

export default GameOver;
